window.bookSummaryJSON = "<p><b>Grayson</b></p> <p>Life has been easy for me. Top of my class. Star quarterback of the football team. Every guy wants to be my friend, and every girl wants to date me.</p> <p>Yeah, life is pretty sweet.</p> <p>Except it’s not.</p> <p>It’s all fake. School comes too easy for me, and I’m bored. Football isn’t fun anymore. The guys I hang out with aren’t really my friends.</p> <p>And the girls? I don’t want to date them.</p> <p>The only one I want to date... He’s a little bit...hostile.</p> <p><b>Rhett</b></p> <p>Life has never been easy for me. A foster kid, lucky enough to be adopted as a teen but who still can’t find a way to be happy.</p> <p>I have two best friends who are amazing and supportive, and yet, I can’t bring myself to tell them my biggest secret.</p> <p>Parents who pay for a private school a kid like me could never have dreamed of...that I hate.</p> <p>It feels all wrong when it should feel right.</p> <p>And I guess...that’s made me nothing but...hostile.</p>"; 
